import React, { useEffect } from "react";
import AOS from "aos";
import "aos/dist/aos.css";
import Tilt from "vanilla-tilt";
import Typed from "typed.js";
import "./App.css";

function App() {
  useEffect(() => {
    AOS.init();
    Tilt.init(document.querySelectorAll(".tilt"));

    // Clean up Tilt on component unmount
    return () => {
      Tilt.destroy();
    };
  }, []);

  // Initialize Typed.js when the component mounts
  useEffect(() => {
    const options = {
      strings: ["Your first string", "Your second string"],
      typeSpeed: 50,
      backSpeed: 50,
      loop: true,
    };

    const typed = new Typed(".auto-type", options);

    // Clean up Typed.js on component unmount
    return () => {
      typed.destroy();
    };
  }, []);

  return (
    <div>
      {/* ========== SIDEBAR ========== */}
      {/* ... (Your existing code for sidebar) */}

      {/* ========== MAIN ========== */}
      <main className="main">
        {/* ===== Home ===== */}
        {/* ... (Your existing code for the home section) */}

        {/* ===== HOBBY ===== */}
        {/* ... (Your existing code for the hobby section) */}

        {/* ... (Repeat for other sections like Movies, Interest, Contact, and Footer) */}

        {/* ========== FOOTER ========== */}
        {/* ... (Your existing code for the footer section) */}
      </main>
    </div>
  );
}

export default App;
